// App.js
import './index.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './pages/HomePage';
import Layout from './components/common/Layout';  // Ensure this path is correct

import "./App.css";
import "./fonts/graphik/GraphikLight.otf";


function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Layout />}>
            <Route index element={<HomePage />} />
            {/* You can add more routes here that will also use the Header */}
          </Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
